(62, 'item/product=62', 'images/kolataha.jpg', 'kolataha.jpg,lap1.jpg,lap2.jpg,konyvlaptarto.png,konyvlaptarto1.png,konyvlaptarto2.png', 1190, '75x28x15 ', 'Egyujjas Könyvlaptartó', 'Praktikus', 'Könnyen használható egyujjas könyvlaptartó olvasáshoz. Ha te is sokat olvasol könyveket úgy, hogy csak a hüvelykujjaddal tartod a könyv lapjait az összecsukódástól, akkor ez a termék nagyban megkönnyítheti az olvasást. Egyszerűen csak dugd be a hüvelykujjad a lyukba és a két szélső toldás majd megtartja a lapokat.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>50mm x 65mm x 5mm</li>\r\n<li>A lyuk átmérője 33mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/3.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:144660\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/alohapussycat/designs\" class=\"bld\">Frank Erfurth</a> készítette. &#169; <!--DATE--> Frank Erfurth. Minden jog fenntartva.', 'bookringbasic', 59, 0, '2020-08-25 23:44:18'),
(64, 'item/product=64', 'images/ossz1.jpg', 'ossz1.jpg,ossz2.jpg,osszefogo.png,osszefogo3.png,osszefogo2.png', 1090, '90x20x7 ', 'Hátizsák Pánt Összefogó ', 'Praktikus', 'Nagyszerű választás lehet laza, a vállról könnyen lecsúszó hátizsák pántok összefogására.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>50mm x 65mm x 5mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:3733804\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/skdzzz/about\" class=\"bld\">Skd zzz</a> készítette. &#169; <!--DATE--> Skd zzz. Minden jog fenntartva.', 'backpack-cord-clip-s-90', 61, 0, '2020-08-25 23:45:32'),
(65, 'item/product=65', 'images/cso2.jpg', 'cso2.jpg,cejo.jpg,cso.png,cso1.png,cso2.png', 1990, '45x45x112', 'Célzóka', 'Praktikus', 'Férfiaknak szánt, hímvesszőre felhúzható eszköz. Merevedési problémákra vagy reggeli vizelési nehézségekre kiválóan használható termék. Egyszerűen csak fel kell húzni a célzókát a férfi hímvesszőre és megkezdeni a vizelést. A célzóka segít abban, hogy a vizelet ne spricceljen és fröcsögjön szét, így higénikusabbá téve a vizelési folyamatot.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>45mm x 45mm x 112mm</li>\r\n<li>A nagyobbik lyuk átmérője 40mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:3733804\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket a <a href=\"https://www.thingiverse.com/skdzzz/about\" class=\"bld\">Zaccord</a> készítette. &#169; <!--DATE--> Zaccord. Minden jog fenntartva.', 'cso_fasza', 17, 1, '2020-06-00 00:00:00'),
(69, 'item/product=69', 'images/efokiha.jpg', 'efokiha.jpg,efoki.jpg,efoki2.jpg,fog_ki2.png', 1890, '75x40x5', 'Egyszerű Fogkrémkinyomó', 'Fürdőszobai Kiegészítők', 'Segítségével könnyen kinyomhatóvá válik a különböző tubusokban és tárolókban lévő maradék fogkrém, festék vagy kenőanyag. A terméken található hosszanti résbe kell befogatni a tubus végét, majd elkezdeni húzni a fogkrémkinyomót a tubus eleje felé.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>75mm x 40mm x 5mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:867811\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/chattercoma/designs\" class=\"bld\">Chatter Coma</a> készítette. &#169; <!--DATE--> Chatter Coma. Minden jog fenntartva.\r\n ', 'fogkrem', 66, 0, '2020-06-00 00:00:00'),
